import React from 'react';
import './App.css';

function App() {
  return (
    <div className="app_wrapper">
      
        <nav className='nav'>
        <a href="#r">Profile</a>
        <div></div>
        <a href="#r">Messages</a>
        <div></div>
        <a href="#r">News</a>
        <div></div>
        <a href="#r">Music</a>
        <div></div>
        <a href="#r">Settings</a>
      </nav>

      <div className='content'>
        <img src='https://jssors8.azureedge.net/demos/image-slider/img/faded-monaco-scenery-evening-dark-picjumbo-com-image.jpg' />
        Main content
      </div>
    </div>
  );
}

export default App;
